def emitSpans(inputStream, outputStream, verbose=False):
    # extract the data and write the result to json file
    currentLabel = None
    currentTokens = []
    spans = []
    def addSpan(u, l, words):
        spans.append( {"uri": u, "category": l, "words": " ".join(words) } )
        if verbose:
            print >> sys.stderr, "  Added %s" % (spans[-1],)

    currentUri = None
    reader = csv.reader(inputStream, delimiter='\t')
    for row in reader:
        if (len(row) <= 1):
            # blank/empty line: expecting "" but might be []
            if currentLabel and currentTokens:
                addSpan(currentUri, currentLabel, currentTokens)
            currentUri = None
            continue
        if (len(row) >= 4):
            # a typical row
            token = row[0]
            uri = row[-2]
            label = row[-1]
            if verbose:
                print >> sys.stderr, "Typical row: %r %r: %r" % (token, uri, label)
            # now process this row
            if label == "O" or label == u'O':
                # unlabeled row
                if currentLabel:
                    # so this concludes span in progress
                    addSpan(uri, currentLabel, currentTokens)
                    currentLabel = None
                    currentTokens = []
                else:
                    pass
            else:
                # Labeled row
                if label == currentLabel:
                    # continue span in progress
                    currentTokens.append(token)
                elif currentLabel and label != currentLabel:
                    # span/span boundary
                    # first conclude old one
                    addSpan(uri, currentLabel, currentTokens)
                    currentLabel = None
                    currentTokens = []
                    # then begin new one
                    currentLabel = label
                    currentTokens = [token]
                elif not currentLabel:
                    # begin novel span
                    currentLabel = label
                    currentTokens = [token]
                else:
                    raise Exception("Unexpected file structure")
        currentUri = uri

    if currentLabel and currentTokens:
        # Input ended without blank line after last marked span, so hallucinate one
        addSpan(uri, currentLabel, currentTokens)

    # Publish results
    json.dump(spans, outputStream)

def computeSpans(v, verbose=False, indexed=False):
    # extract the data and write the result as vector
    currentLabel = None
    currentTokens = []
    spans = []
    def addSpan(u, l, words):
        spans.append( {"uri": u, "category": l, "words": " ".join(words) } )
        if verbose:
            print >> sys.stderr, "  Added %s" % (spans[-1],)

    uri = 'bogus'
    currentUri = None
    for row in v:
        if (len(row) <= 1):
            # blank/empty line: expecting "" but might be []
            if currentLabel and currentTokens:
                addSpan(currentUri, currentLabel, currentTokens)
            currentUri = None
            continue
        if (len(row) >= 4):
            # a typical row
            token = row[0]
            uri = row[-3] if indexed else row[-2]
            label = row[-1]
            if verbose:
                print >> sys.stderr, "Typical row: token %r uri %r: crflabel %r" % (token, uri, label)
            # now process this row
            if label == "O":
                # unlabeled row
                if currentLabel:
                    # so this concludes span in progress
                    addSpan(uri, currentLabel, currentTokens)
                    currentLabel = None
                    currentTokens = []
                else:
                    pass
            else:
                # Labeled row
                if label == currentLabel:
                    # continue span in progress
                    currentTokens.append(token)
                elif currentLabel and label != currentLabel:
                    # span/span boundary
                    # first conclude old one
                    addSpan(uri, currentLabel, currentTokens)
                    currentLabel = None
                    currentTokens = []
                    # then begin new one
                    currentLabel = label
                    currentTokens = [token]
                elif not currentLabel:
                    # begin novel span
                    currentLabel = label
                    currentTokens = [token]
                else:
                    raise Exception("Unexpected file structure")
        currentUri = uri

    if currentLabel and currentTokens:
        # Input ended without blank line after last marked span, so hallucinate one
        addSpan(uri, currentLabel, currentTokens)

    # Publish results
    return spans

